const regexEmail = /^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,4}$/i;
const regexPass = /^(?=.[A-Za-z])(?=.\d)[A-Za-z\d]*$/

export function validate(input) {
 let errors = {}
 if (!regexEmail.test(input.username) && input.username.length < 35) {
  errors.username = 'Por favor completa este campo'
 }
 if (!regexPass.test(input.password) && input.password.length < 11 && input.password.length > 5) {
  errors.password = 'Por favor completa este campo'
 }
 return errors
}
